import SignUp from './components/SignUp.vue'
import Home from './components/Home.vue'
import {createRouter,createWebHistiry} from 'vue-router'

const routes=[
    {
        name:'Home',
        components:Home,
        path:'/'

    },
    {
        name:'SignUp',
        components:SignUp,
        path:'/SignUp'
    },
]

const router=createRouter({
    history:createWebHistiry(),
    routes

})

export default router
